import { LOGIN_REQUEST } from '../actions/auth/auth.types'

export const authReducer = (initialState = {
  name: 'Riz',
})

export default (state = iniitalState, action) => {
  switch (action.type) {
    case LOGIN_REQUEST:
      state = {
        ...state,
      }
      break
  }
  return state
}
